B.GC=new A.ih("Streamflow \u2013 Vesting & LP Lock","ENGH leverages Streamflow, a trusted on-chain vesting protocol on Solana, to secure all major token allocations. Tokens allocated to the team, development, reserve, marketing, community, and even Raydium LP tokens are locked through Streamflow in time-based, immutable streams.\n\nThis ensures:\n\u2022 Team, Development, Marketing/Community and Reserve tokens are vested through Streamflow.\n\u2022 No early unlocks\n\u2022 Full transparency\n\u2022 Community trust\n\u2022 Fully time-locked, viewable, and non-cancellable once deployed.\n\nVesting Details:\n\u2022 Cliff: 3 months\n\u2022 Duration: 2 year linear\n\u2022 Platform: Streamflow\n\n\u2022 Team Vesting\nView on Streamflow\n\u2022 Development Vesting\nView on Streamflow\n\u2022 Reserve Vesting\nView on Streamflow\n\u2022 Marketing & Community Vesting\nView on Streamflow\n\nLP Lock Details:\n\u2022 LP Platform: Raydium\n\u2022 Lock Mechanism: Streamflow\n\u2022 Duration: 1 year\n\u2022 Lock Contract: [Insert Streamflow LP lock link]",null)
