B.Gy=new A.ih("Vibranium Audit","ENGH\u2019s smart contract is being audited by Vibranium Audits, a trusted blockchain security firm, covering the entire project architecture including the token logic, mint and freeze settings, smart contract, Raydium & Meteora liquidity lock, and Streamflow vesting contracts.\n\nAudited Areas:\n\u2022 SPL token contract (mint/freeze authority, supply logic)\n\u2022 Liquidity lock on Raydium via Streamflow\n\u2022 Vesting schedules for team, development, reserve, and community\n\u2022 Wallet ownership and permissions\n\nView Vibranium Audit Report (Insert link when available)",null)
B.GB=new A.ih("Buyback & Burn","50% of all swap fees collected via Raydium are used to buy back ENGH weekly and burn them.\n\nHow it works:\n\u2022 50% of Raydium swap fees go to the buyback wallet\n\u2022 Buybacks occur weekly \u2014 every Sunday\n\u2022 ENGH tokens are bought back from the open market\n\u2022 Bought tokens are sent to the burn address, reducing total supply\n\u2022 This creates ongoing price pressure and community value\n\nBuyback Wallet:\nView on Solscan\nBurn Address:\n11111111111111111111111111111111\nView on Solscan",null)
